    "# Jackknife resampling\n",
    "n <- nrow(dengue_region)\n",
    "theta_jack <- numeric(n)\n",
    "\n",
    "for (i in 1:n) {\n",
    "  theta_jack[i] <- mean(dengue_region$Cases[-i], na.rm = TRUE)\n",
    "}\n",
    "\n",
    "jack_mean <- mean(theta_jack)\n",
    "jack_bias <- (n - 1) * (jack_mean - mean(dengue_region$Cases, na.rm = TRUE))\n",
    "jack_var <- ((n - 1) / n) * sum((theta_jack - jack_mean)^2)\n",
    "jack_se <- sqrt(jack_var)\n",
    "jack_ci <- quantile(theta_jack, probs = c(0.025, 0.975))\n",
    "\n",
    "jackknife_table <- data.frame(\n",
    "  Statistic = c(\"Mean\", \"Bias\", \"Variance\", \"Standard Error\", \"95% CI Lower\", \"95% CI Upper\"),\n",
    "  Value = round(c(jack_mean, jack_bias, jack_var, jack_se, jack_ci[1], jack_ci[2]), 2)\n",
    ")\n",
    "\n",
    "jackknife_table"
   ]
