   "source": [
    "The variance bar chart reveals a notable difference between the bootstrap method and the other two. The bootstrap variance (1,633,820) is lower than the theoretical and jackknife variances, which are both 1,804,176. This suggests that the bootstrap method estimates less variability in the sample means across resamples, implying more confidence in its consistency. On the other hand, the jackknife variance perfectly aligns with the theoretical variance, which reflects how closely jackknife follows classical variance formulas in resampling analysis."
